@RoylesyM @VeraJourova @Ansip_EU @EU_Justice @ChristianWigand Hi @RoylesyM, there is no 'delay' to be announced, the #GDPR will enter into application on 25 May 2018. Rules set forth will be directly applicable in all EU Member States as of 25 May 2018. 
Visit the online tool for more info: https://t.co/Sd1QWBmPw1
Best, Social Media Team

@ZymurgyZo @VeraJourova @Ansip_EU @EU_Justice @ChristianWigand .@ZymurgyZo, we would argue that this will give people more control over their personal data - making it easier to access - and will strengthen our EU internal market.
As a micro business owner, you might be interested in this: https://t.co/YPIbZV6inZ
Best, the Social Media Team https://t.co/NIOkkXn8hu

@ZymurgyZo @VeraJourova @Ansip_EU @EU_Justice @ChristianWigand Hello @ZymurgyZo, actually #GDPR will open up new opportunities for smaller businesses by creating a level playing field across the EU.
We are helping SMEs prepare with our online tool, for citizens/ business/organisations→ https://t.co/E8MqO8FFl7
